import React from 'react'
import "../stylesheets/Portfolio.css"
import "../stylesheets/ContainerTemplates.css"

class Portfolio extends React.Component {

    state = {
        current_tech: ''
    }

    componentDidMount() {
        this.setState({
            current_tech: "all"
        })
    }

    renderProjects = () => {
        return null
    }

    onClickHandler = (e) => {
        this.setState({
            current_tech: e.target.id
        })
    }

    render() {
        console.log(this.state.current_tech)
        return(
            <div id="page-wrapper">
                <div className="buffer"></div>
                <div className="page-header">- PORTFOLIO -</div>
                <div id="content-wrapper-portfolio">
                    <ul id='technology-list'>
                        <li className={this.state.current_tech === "all" ? "navbar-li-selected.tech" : 'navbar-li'}
                            id="all"
                            onClick={this.onClickHandler}>
                            ALL
                        </li>
                        <li className={this.state.current_tech === "javascript" ? "navbar-li-selected.tech" : 'navbar-li'}
                            id="javascript"
                            onClick={this.onClickHandler}>
                            JAVASCRIPT
                        </li>
                        <li className={this.state.current_tech === "react-js" ? "navbar-li-selected.tech" : 'navbar-li'}
                            id="react-js"
                            onClick={this.onClickHandler}>
                            REACT-JS
                        </li>
                        <li className={this.state.current_tech === "ruby-rails" ? "navbar-li-selected.tech" : 'navbar-li'}
                            id="ruby-rails"
                            onClick={this.onClickHandler}>
                            RUBY/RAILS
                        </li>
                    </ul>

                    {this.renderProjects()}


                    {/*<div className="project-wrapper" id="star-iron">STAR IRON</div>*/}
                    {/*<div className="project-wrapper" id="fluffy-tail">FLUFFY TAIL</div>*/}
                    {/*<div className="project-wrapper" id="flatiron-furniture">FLATIRON FURNITURE</div>*/}
                    {/*<div className="project-wrapper" id="table-host">TABLE HOST</div>*/}
                    {/*<div className="project-wrapper" id="online-booking">ONLINE BOOKING</div>*/}
                    {/*<div className="project-wrapper" id="todo-task-manager">TASK MANAGER</div>*/}
                </div>
            </div>
        )
    }
}

export default Portfolio
